import React from 'react';
import PorpTypes from 'prop-types';

const Result=({value })=>{
    console.log(value);
    return(
        <div className="result">
            <span>{value}</span>
        </div>
    )
}
Result.propTypes ={
    value:PorpTypes.string
}
export default Result;
